import React, { Component } from 'react'

export default class IconButton extends Component {
  render() {
    const {src} = this.props;
    return (
        <>
            <button>
                <img
                src={src}
                alt="Delete icon"
                title="Delete"
                id={this.props.id}
                onClick={(e) => {
                    e.preventDefault();
                    onClick();
                  }}
                />
            </button>
        </>
    )
  }
}
